int32_t get_hash(const std::string& s) {
  int32_t res = 0;

  size_t i = s.size()-1;
  for(const auto& c : s) {
    res += ( (long long)(c & 0x1f) * pw[i] ) % M;
    res %= M;
    --i;
  }

  return res;
}

int main() {
  std::cin.tie(0);
  std::ios_base::sync_with_stdio(false);

  /* maybe do: lazy init */
  /* init the modulo powers of P array */
  /*
  uint64_t _res = 1;
  pw[0] = 1;
  for(size_t i=1; i<200000; ++i) {
    _res *= P;
    _res %= M;
    pw[i] = _res;
  }
  */

  std::string s;
  std::cin >> s;
  int64_t original_hash = get_hash(s);
  std::cin >> s;
  int64_t hash = get_hash(s);

  int64_t cycled_hash = hash;
  for(size_t i=0; i<s.size(); ++i) {
    if(cycled_hash == original_hash) {
      std::cout << "Found hash: " << cycled_hash << '\n';
      break;
    }

    cycled_hash -= ((int64_t)(s[i] & 0x1f) * pw[s.size()-1]) % M;
    if(cycled_hash < 0) {
      cycled_hash += M;
    }
    cycled_hash *= P;
    cycled_hash %= M;
    cycled_hash += (s[i] & 0x1f);
    cycled_hash %= M;
  }

  return 0;
}

